This picture reflects the school nature. Vidya Vikas Education Society is a school, which is badly run by the management of the school. Schoolteachers also join the corrupt management and so education takes a back seat. Students are mannerless. Mr. Manohar Ballal comes into the school as a Head Master from educational board &amp; everything changes. Manohar does many experiments on the teachers &amp; students. All of them feel guilty about their previous attitude. Students respect the teachers &amp; teachers love students resulting in Vidya Vikas Education Society becaming an ideal school, and students feeling proud of their school.

The film was chosen for the Pune International Film Festival
It won the Jury Award for Best Film at the Zee Gaurav Puraskar 2006

